import React from 'react'
import { Container, Jumbotron } from 'react-bootstrap';

function Prices(props) {
    return (
        <div>
            <Jumbotron fluid>
            <Container>
                <h5>Prices</h5>
                <ul>
                This is a modified jumbotron that occupies the entire horizontal space of
                its parent.
                </ul>
            </Container>
            </Jumbotron>
        </div>
    )
}

export default Prices;
